import React from 'react';
import Mongodb from '../components/Express';
import Header from '../components/Header';
import Footer from '../components/Footer';


function ExpressPage() {
  return (
    <div>
      <Header/>
     <Express/>
     <Footer/>
    </div>
  );
}

export default ExpressPage;
